import React from "react";

const NFT = () => {
  return (
    <div>
      <div class="card bg-blur">
        <h1>Go to the future and sell NFT's</h1>
        <form action="https://google.com">
          <input
            className="btn btn-gradient-border btn-glow"
            type="submit"
            value="          Go To Market Place
"
          />
        </form>
        <button></button>
      </div>
    </div>
  );
};

export default NFT;
